import Vue from "vue";
import Router from "vue-router";
import UserGroup from "./views/Users.vue";
import Layout from "./views/Layout.vue";
import UserGroupDetail from "./views/UsersGroup.vue";
import Logout from "./views/Logout.vue";
import Login from "./views/Login.vue";
import Authentication from "./views/Authentication.vue";

Vue.use(Router);

export default new Router({
    mode: "history",
    base: process.env.BASE_URL,
    routes: [
        { path: "*", redirect: "/admin" },
        {
            path: "/auth",
            meta: {
                requireAuth: false,
                auth: 2
            },
            component: Authentication
        },
        {
            path: "/login",
            meta: {
                requireAuth: false,
                auth: 2
            },
            component: Login
        },
        {
            path: "/logout",
            meta: {
                requireAuth: true,
                auth: 2
            },
            component: Logout
        },

        {
            path: "/admin",
            meta: {
                requireAuth: true,
                auth: 2
            },
            component: Layout,
            children: [
                {
                    path: "",
                    redirect: "userGroup",
                    meta: {
                        requireAuth: true,
                        auth: 2
                    }
                },
                {
                    path: "userGroup",
                    meta: {
                        requireAuth: true,
                        auth: 2
                    },
                    component: UserGroup
                },
                {
                    path: "userGroupDetail",
                    name: "userGroupDetail",
                    meta: {
                        requireAuth: true,
                        auth: 2
                    },
                    component: UserGroupDetail
                }
            ]
        }
    ]
});
